<p>\u7CFB\u7EDF\u4F1A\u6267\u884C<code v-pre>package.json</code>\u4E2D<code v-pre>&quot;scripts&quot;</code>\u4E2D\uFF0C\u914D\u7F6E\u597D\u7684\u5FEB\u6377\u6307\u4EE4<code v-pre>&quot;dev&quot;: &quot;vue-cli-service serve&quot;</code>\u3002</p>
